import Image from 'next/image'
import { IoGrid } from "react-icons/io5";
import { RiShoppingBasketFill } from "react-icons/ri";
import { IoSearchOutline } from "react-icons/io5";
import { CgOptions } from "react-icons/cg";

import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'





const Nav = (props) => {
    return (
        <nav className="flex justify-between items-center w-full h-[5em]  text-block relative  font-mono navbar bg-[#0b182c]">

            <div className="">
                <h2>Freshy Ride</h2>
            </div>


            <div className="flex md:mr-[20px] mr-[1px] mt-[8px]">


                <div className="space-x-4 mr-4 orderlist">
                    {link.map((nav) => {
                        const { id, text, path } = nav;
                        return (

                            <Link as={`/${nav.path}`} href='/[pages]'>

                                <a>{text}</a>
                            </Link>

                        )
                    })}
                </div>




            </div>

        </nav>
    )
}


export default Nav
